import React from "react";
import {
  MDBContainer,
  MDBRow,
  MDBCol,
  MDBIcon,
  MDBChart
} from "mdbreact";

class ChartsPagePro extends React.Component {
  render() {
    return (
      <MDBContainer>
        <h3 className="mt-5">Minimalistic charts</h3>
        <div style={{ marginTop: "100px" }}>
          <MDBContainer>
            <MDBRow className="text-center">
              <MDBCol sm="4">
                <MDBSimpleChart
                  width={100}
                  height={100}
                  strokeWidth={3}
                  percent={56}
                  strokeColor="#4FB64E"
                  labelFontWeight="300"
                  labelColor="#000"
                />
                <h6 className="mt-5">
                  <span className="label green p-1 white-text">
                    <strong>Sales</strong>
                    <MDBIcon icon="arrow-circle-up" className="ml-1" />
                  </span>
                </h6>
              </MDBCol>
              
            </MDBRow>
          </MDBContainer>
        </div>
      </MDBContainer>
    );
  }
}

export default ChartsPagePro;
